import React from 'react';
import Post from './Post';

const Posts = ({ posts }) => {
  return (
    <div className='posts'>
      {posts.map} <Post />
      <Post />
      <Post />
      <Post />
      <Post />
      <Post />
    </div>
  );
};

export default Posts;
